import "./home.scss";
import Header from "../components/Header";
import Intro from "../components/Intro";
import Footer from "../components/Footer";

function Home() {
	return (
		<div className="home">
			<Header />
			<Intro />
			<Footer />
		</div>
	);
}

export default Home;
